import React from 'react';

const Url = ({ Sub }) => {

    const redirect = () => {
        window.location.href = Sub.url;
    }

    return (
        <li className='subcat-items-content' onClick={redirect}>
            <div>
                <b> </b>{Sub.id}
            </div>
        </li>
    );
}

export default Url;
